pragma solidity 0.4.24;

contract Orders {
    address Carrier;

    struct orders {
        string orderId;
        string orderStatus;
    }
}

contract POD {
    // Model a POD

    string orderId;
    string lastStatus;
    address oCarrier;
    address owner;
    bool signed;


    struct OrderStatus {
        uint orderStatusId;
        address statusBy;
        string status;
    }

    uint public orderStatusCount = 0;

    OrderStatus[] public orderStatusList;

    event OrderAlreadySigned (string _orderId);

    constructor(string _orderId) public{
       owner = msg.sender;
       orderId = "test2";
       lastStatus = "Created";
       signed = false;
    }

    function getOrder() public constant returns (string _orderId, string _status, bool _signed) {
        return (orderId, lastStatus, signed);
    }

    function addCarrier (address _Carrier) public {
        oCarrier = _Carrier;
    }

    function addOrderStatus(string _status) public {
        if (signed == true) {
            emit OrderAlreadySigned("Order Already Signed");
        } else {
        if (keccak256(_status) == keccak256("Signed")) {
            signed = true;
        }
        orderStatusCount++;
        OrderStatus memory orderStatus = OrderStatus(orderStatusCount, msg.sender, _status);   
        orderStatusList.push(orderStatus);
        lastStatus = _status;
        }
    }

    function getStatusCount() public constant returns (uint statusCount) {
        return orderStatusList.length;
    }
}
